import React from 'react'
import { useParams } from 'react-router-dom'
import { Box } from '@mui/material';
export default function JoinSubasta(){
    const { id } = useParams();

    return (
        <>
            <Box sx={{ paddingTop: 2 }}>
            <div>JoinSubasta - {id}</div>
            </Box>
        </>
    )
}
